import './App.css';
import { useState } from 'react';

const App = () => {
  const [counter, setCounter] = useState(0);
  let countAdd = counter + 1
  let countSub = counter - 1
  return (
    <div className="App">
      <button onClick={() => setCounter(countAdd)}>+</button>
      <p>{counter}</p>
      <button onClick={() => setCounter(countSub)}>-</button>
    </div>
  );
}

export default App;
